import './App.css';
import Clock from './components/clock/Clock';
import Navbar from './components/navbar/Navbar.js'


function App() {
  return (
    <div className="App">
        <Navbar></Navbar>
        <div className={"row col-lg-12"}>
            <Clock locale='en-US' timeZone='EST' timeZoneName='short'></Clock>

            <Clock locale='en-US' timeZone='MST' timeZoneName='short'></Clock>
            <Clock locale='en-US' timeZone='UTC' timeZoneName='short'></Clock>
        </div>
    </div>
  );
}

export default App;
